  `pid` int(11) NOT NULL DEFAULT '0' COMMENT 'The md7_comment.cid to which this comment is a reply. If set to 0, this comment is not a reply to an existing comment.',
  `nid` int(11) NOT NULL DEFAULT '0' COMMENT 'The md7_node.nid to which this comment is a reply.',
