INSERT INTO `md7_menu_custom` VALUES ('navigation','Navigation','The <em>Navigation</em> menu contains links intended for site visitors. Links are added to the <em>Navigation</em> menu automatically by some modules.'),('management','Management','The <em>Management</em> menu contains links for administrative tasks.'),('user-menu','User menu','The <em>User</em> menu contains links related to the user\'s account, as well as the \'Log out\' link.'),('main-menu','Main menu','The <em>Main</em> menu is used on many sites to show the major sections of the site, often in a top navigation bar.'),('menu-secondary-menu','Secondary Menu',''),('features','Features','Menu items for any enabled features.');
